import React from 'react';
import ParkingArea from './ParkingArea';
import './ParkingSpaces.css';

const ParkingSpaces = ({ spaces, setSpaces, handleSave }) => {
  return (
    <div className="parking-spaces">
      <div className="toolbar">
        <button onClick={() => setSpaces([...spaces, { id: spaces.length, type: 'villa', width: 100, height: 100, left: 50, top: 50 }])}>Add Villa</button>
        <button onClick={() => setSpaces([...spaces, { id: spaces.length, type: 'parking-space', width: 100, height: 100, left: 50, top: 50 }])}>Add Parking Space</button>
        <button onClick={() => setSpaces([...spaces, { id: spaces.length, type: 'exit', width: 100, height: 100, left: 50, top: 50 }])}>Add Exit</button>
        <button onClick={() => setSpaces([...spaces, { id: spaces.length, type: 'wall', width: 100, height: 100, left: 50, top: 50 }])}>Add Wall</button>
      </div>
      <ParkingArea spaces={spaces} setSpaces={setSpaces} />
      <button onClick={handleSave}>Save</button>
    </div>
  );
};

export default ParkingSpaces;
